import React from 'react'
import'./Popup.css'
export default function Popup(props) {
  return (
    <div className='pop'>
      
        <input type="text" name='date' value={props.date.toString()} />
        <input type="text" name='name' placeholder='Name'/>
        <input type="text" name='age' placeholder='Age'/>
        <input type="text" name='name' placeholder='Name'/>
        <input type="text" name='name' placeholder='Name'/>


    </div>
  )
}
